import React, { Component } from 'react'
import BlaBla from '../../../Components/BlaBLa/BlaBla'
import ButtonProject from '../../../Components/ButtonProject/ButtonProject';

class SectionTwo extends Component {
  state = {
    blabla:
    {
      id: 1, title: 'DEVELOPPEUR WEB', subtitle: 'Front-End, Freelance', text: "Grâce à mon expérience professionnelle, j'ai pu suivre de multiples cours sur les languages suivants : HTML, CSS, Javascript. Et ainsi étendre mes compétences digitale. Certifié du Wagon après un bootcamp de deux mois, où j'ai pu compléter mes compétences par un language supplémentaire, Ruby et son framework, Rails. Formation à la suite de laquelle j'ai décidé me spécialiser en tant que développeur web Full-Stack. Également inscrit à l'Ecole 42 pour 2020."
    },
    inputs: [
      { alt: 'French', img: 'https://us.123rf.com/450wm/iakhiiadmytro/iakhiiadmytro1701/iakhiiadmytro170100164/70473411-flat-icon-in-black-and-white-map-of-france.jpg?ver=6' },
      { alt: 'English', img: 'https://us.123rf.com/450wm/iakhiiadmytro/iakhiiadmytro1701/iakhiiadmytro170100133/70472687-flat-icon-in-black-and-white-united-states-map.jpg?ver=6' },
      { alt: 'Néerlandais', img: 'https://previews.123rf.com/images/iakhiiadmytro/iakhiiadmytro1701/iakhiiadmytro170100165/70473412-flat-icon-in-black-and-white-netherlands-map.jpg' }
    ]
  }

  render() {
    return (
      <div id="section-two" className="section-two">
        <a id="Développeur-Web" className="section-anchor"></a>
        <div className="section-wrapper">
          <div className="section-left d-none d-sm-block col-sm-6 col-md-6 align-center">
            <div className="section-wrapper-left">
              <span className="circle"></span>
              <div className="image-show-off">
                <div className="clipped-border">
                  <img src="https://upload.wikimedia.org/wikipedia/commons/6/61/HTML5_logo_and_wordmark.svg" alt="HTML5" id="clipped" />
                </div>
                <div className="clipped-border">
                  <img src="https://icn.lycee-valin.fr/projets2018/seconde14/eleve12/images/javascript.png" alt="Javascript" id="clipped" />
                </div>
                <div className="clipped-border">
                  <img src="https://upload.wikimedia.org/wikipedia/commons/d/d5/CSS3_logo_and_wordmark.svg" alt="CSS3" id="clipped" />
                </div>
              </div>
            </div>
          </div>
          <div className="section-right col-xs-12 col-sm-6 col-md-6">
            <BlaBla blabla={this.state.blabla} />
            <ButtonProject />
          </div>
        </div>
      </div>
    )
  }
}

export default SectionTwo;
